Meg amúgy is látják, hogy 3 oltás után elkapta ismerõsük és mennyire nagyon rosszul van. Akkor minek az oltás?
Járványban nem oltunk!4!

@viktoriaserdult Egyik ismerõs bízik az immunrendszerében, C vitamin, sok gyümölcs, stb., aztán elkapta. Végül sikerült meggyõzni, egy oltása már van.

Egy másik azért nem akarta korábban, mert a Janssenre várt, az egy oltás csak, nem szereti a szúrást. 50+-os.

Az immunrendszer többeknél is.

@dreszer Mondjuk szerintem otthon nem is kell ettõl félni <U+0001F601>
Én úgy vagyok vele hogy ha ez kell hogy legyen szabad korházi ágy ha ne adj isten a lányomnak vagy a feleségemnek valami baja lesz hát legyen.
Februártól kötelezõ lesz az oltás én remélem hogy jövõre már nem kell lockdown.

